function jsa2urlqry(a,s0,s1){
  var q='';
  if(a) for (var i=0;i<a.length/2;i++) {
     if ( a[2*i+1] instanceof Array) {
        var suba=a[2*i+1];
        for (var j=0;j<suba.length;j++) {
           q = q+((i+j==0)?s0:s1)+trim(a[2*i])+'[]='+trim_encode(suba[j]);
        }
     } else
     if(trim(a[2*i+1])!="") {
        q = q+((i==0)?s0:s1)+trim(a[2*i])+'='+trim_encode(a[2*i+1]);
     }
  }
  return q;
}

function jsa2json(q,sep){
  if(!sep) sep='[],';
  var res=sep.charAt(0);
  for(var i=0;i<q.length;i++){
    res=res+((i==0)?'':sep.charAt(2));
    if(q[i] instanceof Array){
       res=res+jsa2json(q[i],sep);
    }else{
      if (typeof q[i] === 'string' || q[i] instanceof String){
        res=res+'"'+q[i]+'"';
      }else{
        res=res+q[i];
      }
    }
  }
  return res+sep.charAt(1);
}


//js matrix to json (for matrix all dim are the same size)
function jsm2json(q,iarr,sep,lev){
  if(!sep) sep='[],';
  if(!lev) lev=0;
  var res=sep.charAt(0), lev_iarr=[];
  if(iarr[lev])lev_iarr=iarr[lev]; else for(var i=0;i<q.length;i++){lev_iarr[i]=i;}
  for(var i=0;i<lev_iarr.length;i++){
    res=res+((i==0)?'':sep.charAt(2));
    if(q[lev_iarr[i]] instanceof Array){
       res=res+jsm2json(q[lev_iarr[i]],iarr,sep,(lev+1));
    }else{
      if (typeof q[lev_iarr[i]] === 'string' || q[lev_iarr[i]] instanceof String){
        res=res+'"'+q[lev_iarr[i]]+'"';
      }else{
        res=res+q[lev_iarr[i]];
      }
    }
  }
  return res+sep.charAt(1);
}

