function copy_attr(to_el, to_attr, fr_el, fr_attr) {
   if (!fr_el.hasAttribute(fr_attr)) return 0;
   to_el.setAttribute(to_attr, fr_el.getAttribute(fr_attr));
   return 1;
}

function move_attr(to_el, to_attr, fr_el, fr_attr) {
   if (!copy_attr(to_el, to_attr, fr_el, fr_attr)) return;
   fr_el.removeAttribute(fr_attr);
}

function set_attr(el, attr, val, overwrite=true) {
   if (!overwrite && el.hasAttribute(attr)) return;
   el.setAttribute(attr, val);
}

function get_attr(el, attr, def='') {
   if (!el.hasAttribute(attr)) return def;
   return el.setAttribute(attr);
}

function rename_attribute(el, attr, newattr) {
   /* same as move_attr(el, attr, el, newattr) */
   if (!el.hasAttribute(attr)) return;
   el.setAttribute(newattr, el.getAttribute(attr));
   el.removeAttribute(attr);
}

