function object_keys(obj) {
  var res = [];
  for (var key in obj) {
    if (!obj.hasOwnProperty(key)) continue;
    res.push(key);
  }
  return res;
}

function isOnScreen(elem, pad, pad_bottom, onlyTop) {
  if( elem.length==0) return;
  if( typeof pad == 'undefined') pad=50; /* in percent of screen form the middle */
  if( typeof pad_bottom== 'undefined') pad_bottom=pad;
  var $window = jQuery(window)
  var rheight = $window.height();
  var vp_middle = $window.scrollTop()+(0.5*rheight);
  var vp_top = Math.max((vp_middle-(pad/100)*rheight),0);
  var vp_height = rheight*(pad+pad_bottom)/100;
  var vp_bottom = vp_middle + (pad_bottom/100)*rheight;
  var $elem = jQuery(elem);
  var top = $elem.offset().top;
  if( onlyTop ) {
    var height = 1;
  } else {
    var height = $elem.height();
  }
  var bottom = top + height;

  if (top < vp_bottom && bottom > vp_top) {
   var t = 1;
  }

  return (top < vp_bottom && bottom > vp_top);
}

function onTouchScroll() {
  var a = document.readyState ;
  var w = Math.max(document.documentElement.clientWidth, window.innerWidth || 0)
  var h = Math.max(document.documentElement.clientHeight, window.innerHeight || 0)
  sctop = (document.documentElement.scrollTop + document.body.scrollTop
                == document.documentElement.scrollTop) ?
                document.documentElement.scrollTop : document.body.scrollTop;
  min_y = sctop+3*h/8; max_y = sctop+6*h/8;
  var new_endiv_arr = {};
  if( isTouchDevice) for (var i=0;i<imging_arr.length;i++) {
    //if( document.readyState != 'complete' ) {
      imging_arr[i][1] = findPositionY(imging_arr[i][2]);
    //}
    if( imging_arr[i][1] < min_y) continue;
    if( imging_arr[i][1] > max_y) break;
    new_endiv_arr[i] = 1;
    if ( i in imging_endiv_arr ) continue;
    toggle_class(imging_arr[i][3], 'do_hover', 1);
  }
  var key_arr = object_keys(imging_endiv_arr);
  for (var j =0; j<key_arr.length;j++) {
    i = key_arr[j];
    if( key_arr[j] in new_endiv_arr) continue;
    toggle_class(imging_arr[i][3], 'do_hover', 0);
  }
  imging_endiv_arr = new_endiv_arr;
}

