function safeload_img44(img, errimg, docproto) {
  var tmpimg = new Image();
  tmpimg.onerror = function(e) { 
    img.src = errimg;
  }
  tmpimg.onload = function() {
    if (tmpimg.src.match(/data:/)) {
      copy_attr(img, 'src', tmpimg, 'src');
    } else if (tmpimg.src.match(/https:/)) {
      copy_attr(img, 'src', tmpimg, 'src');
    } else if (tmpimg.src.match(/http:/) && docproto == 'https:' ) {
      /* tmpimg.src = tmpimg.src.replace('http:', 'https:'); */
      /* prevent mixed-content warning */
      img.src = errimg;
    } else {
      copy_attr(img, 'src', tmpimg, 'src');
    }
  }
  copy_attr(tmpimg, 'srcset', img, 'data-srcset');
  copy_attr(tmpimg, 'src',    img, 'data-src');
  toggle_class(img, 'do-lazy', 0);
}

