        function ssticky_apply(p, c, offset, dl, rst) {
          if( $(p).length == 0) return;
          var stickyTop = $(p).offset().top;
          var windowTop = offset+$(window).scrollTop();
          /*
          var cntnr_lth = $(p).offset().top + $(p).height() - $(c).height();
          */
          var cntnr_lth = 10000000;
          if( rst || stickyTop > windowTop) {
            if ($(c).data('rsst')!=1 ) {
              /* relative s=1 */
              $(c).css({"position": "unset", "top": "unset", "z-index":"unset", "left":"unset"});
              $(p).css({"height": "unset"});
              if (rst) $(c).removeData('rsst');
              else $(c).data('rsst',1);
            }
          } else if( cntnr_lth > windowTop) {
            if ($(c).data('rsst')!=2) {
              /* fix top of viewport s=2 */
              $(p).css({"height": $(c).height()});
              $(c).css({"position": "fixed", "top": offset+"px", "z-index":"2"});
              if(dl)$(c).css({"left":"0px"});
              $(c).data('rsst',2);
            }
          } else if( $(c).data('rsst')!=3 ){
              /* absolute at the bottom of container s=3 */
              $(c).css({"position": "absolute", "bottom": "0px"});
              $(c).data('rsst',3);
          }
        }
